import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {

    const [peopleCount, setPeopleCount] = useState(1);

    const [url, setUrl] = useState([<input type="text" name="1"></input>]);

    return <>
    <div class='App'>
        <h1>Bob 먹자 Go</h1>
        <input type="button" value='+' onClick={()=> {
            var curr_peopleCount = peopleCount;
            curr_peopleCount++;
            setPeopleCount(curr_peopleCount);

            var curr_url = url;
            curr_url.push(<input type="text" name={String(curr_peopleCount)}></input>);
            console.log(curr_url);
            // curr_url = curr_url + <input type="text" name={curr_peopleCount.toString}></input>
            setUrl(curr_url);
        }}></input>
        <h1>{peopleCount}</h1>
        <form>
            {url}
        </form>
    </div>
    </>
}
export default Home;
